import React, { Component } from 'react'
import { Link } from 'react-router-dom'
export default class Footer extends Component {
    render() {
        return (
            <div className="footer">
                <h2 className="footer__title">This project was created by KPI students</h2>
                <div className="footer__social-container">
                    <Link to="https://github.com/dergachev456" className="footer__social">dergachev456</Link>
                    <Link to="https://github.com/alejinjer" className="footer__social">alejinjer</Link>
                    <Link to="/" className="footer__social">yakov</Link>
                </div>
            </div>
        )
    }
}
